code.value:
RFE_ERROR_GUARD
{
    rfeHwPit_enableTimer( RFE_WAIT_WAITTIMER_INDEX, RFE_WAIT_WAITTIMER_TIMERLOADVALUE, RFE_ERROR_FUNCTION_ARGUMENT);
    if ( RFE_ERROR_IS_NO_ERROR )
    {
        RFE_WAIT_TICKS( 1ul );
    }
    else
    {
    /* nothing */
    }
}

	rfeWait_waitDoNestLevel = 0ul;
	for ( rfeHwPit_timerIndex_t timerindex = 0ul; ( RFE_WAIT_MAXIMUM_NUMBER_WAITDO_NESTS <= timerindex ) ; timerindex++ )
	{
		rfeWait_waitDoCompleted[ timerindex ] = false;
	}

if ( RFE_WAIT_MAXIMUM_NUMBER_WAITDO_NESTS <= rfeWait_waitDoNestLevel )
{
	RFE_ERROR_SET( rfe_error_boundedWaitResourcesExhausted_e );
}
else
{
	rfeWait_waitDoNestLevel++;
	rfeWait_waitDoCompleted[ rfeWait_waitDoNestLevel -1ul ] = false;

	rfeHwPit_enableTimer(
		RFE_WAIT_WAITTIMER_INDEX - rfeWait_waitDoNestLevel,
		timeoutvalue,
		RFE_ERROR_FUNCTION_ARGUMENT );
}

if ( 0ul == rfeWait_waitDoNestLevel )
{
	RFE_ERROR_SET( rfe_error_boundedWaitNotValidResource_e );
}
else
{
	rfeHwPit_disableTimer(
			RFE_WAIT_WAITTIMER_INDEX - rfeWait_waitDoNestLevel,
			RFE_ERROR_FUNCTION_ARGUMENT );
	// Do not modify rfeWait_waitDoCompleted[] it may be needed afterwards
	rfeWait_waitDoNestLevel--; // mirror symmetric to addtimer sequence
}

if ( ( 0ul != rfeWait_waitDoNestLevel ) && ( RFE_WAIT_MAXIMUM_NUMBER_WAITDO_NESTS >= rfeWait_waitDoNestLevel ) )
{
	rfeWait_waitDoCompleted[ rfeWait_waitDoNestLevel -1ul ] = true;
}
else
{
	RFE_ERROR_SET( rfe_error_boundedWaitNotValidResource_e );
}

bool wascompleted = false;
if ( RFE_WAIT_MAXIMUM_NUMBER_WAITDO_NESTS > rfeWait_waitDoNestLevel )
{
	wascompleted = rfeWait_waitDoCompleted[ rfeWait_waitDoNestLevel ];
}
else
{
	wascompleted = false;
}
return wascompleted;

if ( RFE_WAIT_MAXIMUM_NUMBER_WAITDO_NESTS > rfeWait_waitDoNestLevel )
{
	rfeWait_waitDoCompleted[ rfeWait_waitDoNestLevel ] = false;
}
else
{
	/* do nothing */
}

bool doContinue = false;
if ( 0ul != rfeWait_waitDoNestLevel )
{
	bool didTimeout = rfeHwPit_didTimerTimedout(
			RFE_WAIT_WAITTIMER_INDEX - rfeWait_waitDoNestLevel,
			RFE_ERROR_FUNCTION_ARGUMENT );

	doContinue = ( ! didTimeout	) &&
				 ( RFE_ERROR_IS_NO_ERROR ) &&
				 ( ! rfeWait_waitDoCompleted[ rfeWait_waitDoNestLevel -1ul ] );
}
return doContinue;
